import React from "react";
import "./AddNewStudent.css"

const AddNewStudent = (props) => {
    let val = "";

    const SubmitHandler = (event) => {
        event.preventDefault();


    }

    const changeHandler = (event) => {
        val = event.target.value()

    }

    return ( 
        <div>
            <form onSubmit={SubmitHandler} className="add_student__form">
                <input onChange={changeHandler} value={val} className="input_student" type="text" placeholder="Enter Name Of Student" />
                <input onChange={changeHandler} value={val} className="input_student" type="number" placeholder="Enter Student Number" />
                <input onChange={changeHandler} value={val} className="input_student" type="text" placeholder="Enter Student userName" />
                <input onChange={changeHandler} value={val} className="input_student" type="text" placeholder="Enter Student pass" />
                <button type="submit">Add this Student</button>
            </form>
        </div>
     );
}

export default AddNewStudent;
